import React from "react";

export default function Table({ releasesData, headerConfig }) {
  console.log(releasesData);
  return (
    <div className="Table">
      <input
        type="text"
        id="myInput"
        placeholder="Search for names.."
        title="Type in a name"
      ></input>
      <table id="myTable">
        <tbody>
          <tr className="header">
            {headerConfig.map((header, headerIndex) => {
              return (
                <th
                  key={`header_${headerIndex}`}
                  style={{ width: header.width }}
                >
                  {header.name}
                </th>
              );
            })}
          </tr>
          {releasesData.map((song, index) => {
            return (
              <tr key={`songs_${index}`}>
                {headerConfig.map((header, hindex) => {
                  return (
                    <td key={`dataIndex_${hindex}`}>{song[header.key]}</td>
                  );
                })}
                {/* <td>{song.label}</td>
                <td>{song.title}</td>
                <td>{song.trackinfo}</td>
                <td>{song.year}</td> */}
              </tr>
            );
          })}
        </tbody>
      </table>
    </div>
  );
}
